def compute_precision_recall(predicted, ground_truth, k):
    """
    Computes precision and recall at top-k.
    
    Parameters:
        predicted (list): List of predicted results (tuples).
        ground_truth (list): List of ground truth results (tuples).
        k (int): Number of top results to consider.
        
    Returns:
        precision (float): The precision at k.
        recall (float): The recall at k.
    """
    # Extract the top-k edge tuples from both lists.
    pred_topk = {extract_edge(res) for res in predicted[:k]}
    gt_topk = {extract_edge(res) for res in ground_truth[:k]}
    
    # Compute the intersection.
    true_positives = pred_topk.intersection(gt_topk)
    
    precision = len(true_positives) / float(len(pred_topk)) if pred_topk else 0.0
    recall = len(true_positives) / float(len(gt_topk)) if gt_topk else 0.0
    return precision, recall

def extract_edges(dfscode):
    """
    Converts a DFSCode list into an immutable tuple of tuples for set operations.
    """
    return tuple(tuple(edge) for edge in dfscode)  # Convert list of lists into tuple of tuples

def compute_common(predicted, ground_truth):
    """
    Computes the common elements between predicted and ground truth DFSCode results.
    
    Parameters:
        predicted (list): List of predicted DFSCode results (tuples).
        ground_truth (list): List of ground truth DFSCode results (tuples).
        
    Returns:
        common_set (set): The set of common elements in both predicted and ground truth.
    """
    pred = {extract_edges(code) for _, _, code in predicted}  # Convert to immutable tuples
    gt = {extract_edges(code) for _, _, code in ground_truth}

    false_p = pred - gt
    false_n = gt - pred

    return pred.intersection(gt), len(false_p), len(false_n)  # Find common elements


# --- Revised Relevance and DCG functions using binary relevance ---
def relevance_score(edge, ground_truth):
    """
    Returns 1 if the edge is present in the ground truth, 0 otherwise.
    """
    gt_edges = [extract_edge(res) for res in ground_truth]
    return 1 if edge in gt_edges else 0

def dcg_at_k(ranked_list, ground_truth, k):
    """
    Compute Discounted Cumulative Gain (DCG) for the top-k results using binary relevance.
    """
    pred_edges = [extract_edge(res) for res in ranked_list[:k]]
    # For binary relevance, each relevant item contributes 1.
    return sum(
        (1 if edge in {extract_edge(res) for res in ground_truth} else 0) / np.log2(i + 2)
        for i, edge in enumerate(pred_edges)
    )

def idcg_at_k(ground_truth, k):
    """
    Compute Ideal Discounted Cumulative Gain (IDCG) for the top-k results.
    If all k items are relevant, the ideal gain is the sum of 1/log2(i+2) for i in range(min(k, len(ground_truth))).
    """
    num_relevant = min(k, len(ground_truth))
    return sum(1.0 / np.log2(i + 2) for i in range(num_relevant))

def ndcg_at_k(predicted, ground_truth, k):
    """
    Compute Normalized Discounted Cumulative Gain (NDCG) for the top-k results.
    With binary relevance, NDCG is always between 0 and 1.
    """
    dcg = dcg_at_k(predicted, ground_truth, k)
    idcg = idcg_at_k(ground_truth, k)
    return dcg / idcg if idcg > 0 else 0.0

